Description. Habitus elongate, fusiform. Body colouring from brownish-red to brown. Pale part of setation consists of recumbent yellowish or yellow greyish setae forming indistinct ocellations on pronotum, and characteristic ocellations on elytra (
Fig. 14
).

Head punctation consists of sparse, irregularly distributed moderately large setigerous punctures. Antenna long, slender, last antennomere rectangular, with apical elongation, 3.19–3.63 times as long as wide (
Fig. 35
), its ventral side smooth.

Pronotum trapezoidal, ca. 2.01–2.04 times as wide as long. Sides almost regularly rounded (
Fig. 55
). The disc with two indistinct rounded depressions. Punctation consists of sparse fine setigerous punctures on the disc, which become slightly coarser and denser laterally.

Male. Aedeagus with phallobase of the same length as parameres. Parameres simple, broad, slightly attenuating to subapical hook. Their subbasal hook is missing, but the subapical hook is well developed and prominent. Median lobe lanceolate (
Fig. 75
).
